import React from 'react';
import MapGL, { Marker } from 'react-map-gl';

function MapPage() {
  const MAPBOX_TOKEN = 'pk.eyJ1IjoiZmVyb3BlcyIsImEiOiJjbHZ0amdxa3kxYnp3MmxtaGo3bjkzcml3In0.IVlmneQW7Me9kUfvoF6DkQ';
  const [viewport, setViewport] = React.useState({
    width: '100%',
    height: 400,
    latitude: 37.742828,
    longitude: -25.680588,
    zoom: 8
  });

  return (
    <div className="map-page">
      <h2>Map Page</h2>
      <MapGL
        {...viewport}
        mapStyle="mapbox://styles/mapbox/streets-v9"
        onViewportChange={setViewport}
        mapboxApiAccessToken={MAPBOX_TOKEN}
      >
        <Marker latitude={37.742828} longitude={-25.680588} offsetLeft={-20} offsetTop={-10}>
          <div style={{ color: 'red', fontSize: '24px' }}>P</div>
        </Marker>
      </MapGL>
    </div>
  );
}

export default MapPage;
